chen-sink.nvim ;)","","return {","  -- NOTE: Yes, you can install new plugins here!","  'mfussenegger/nvim-dap',","  -- NOTE: And you can specify dependencies as well","  dependencies = {","    -- Creates a beautiful debugger UI","    'rcarriga/nvim-dap-ui',","","    -- Installs the debug adapters for you","    'williamboman/mason.nvim',","    'jay-babu/mason-nvim-dap.nvim',","","    -- Add your own debuggers here","    'leoluz/nvim-dap-go',","  },","  config = function()","    local dap = require 'dap'","    local dapui = require 'dapui'","","    require('mason-nvim-dap').setup {","      -- Makes a best effort to setup the various debuggers with","      -- reasonable debug configurations","      automatic_setup = true,","","      -- You can provide additional configuration to the handlers,","      -- see mason-nvim-dap README for more information","      handlers = {},","","      -- You'll need to check that you have the required things installed","      -- online, please don't ask me how to install them :)","      ensure_installed = {","        -- Update this to ensure that you have the debuggers for the langs you want","        'delve',","      },","    }","","    -- Basic debugging keymaps, feel free to change to your liking!","    vim.keymap.set('n', '<F5>', dap.continue, { desc = 'Debug: Start/Continue' })","    vim.keymap.set('n', '<F1>', dap.step_into, { desc = 'Debug: Step Into' })","    vim.keymap.set('n', '<F2>', dap.step_over, { desc = 'Debug: Step Over' })","    vim.keymap.set('n', '<F3>', dap.step_out, { desc = 'Debug: Step Out' })","    vim.keymap.set('n', '<leader>b', dap.toggle_breakpoint, { desc = 'Debug: Toggle Breakpoint' })","    vim.keymap.set('n', '<leader>B', function()","      dap.set_breakpoint(vim.fn.input 'Breakpoint condition: ')","    end, { desc = 'Debug: Set Breakpoint' })","","    -- Dap UI setup","    -- For more information, see |:help nvim-dap-ui|","    dapui.setup {","      -- Set icons to characters that are more likely to work in every terminal.","      --    Feel free to remove or use ones that you like more! :)","      --    Don't feel like these are good choices.","      icons = { expanded = '▾', collapsed = '▸', current_frame = '*' },","      controls = {","        icons = {","          pause = '⏸',","          play = '▶',","          step_into = '⏎',","          step_over = '⏭',","          step_out = '⏮',","          step_back = 'b',","          run_last = '▶▶',","          terminate = '⏹',","          disconnect = '⏏',","        },","      },","    }","","    -- Toggle to see last session result. Without this, you can't see session output in case of unhandled exception.","    vim.keymap.set('n', '<F7>', dapui.toggle, { desc = 'Debug: See last session result.' })","","    dap.listeners.after.event_initialized['dapui_config'] = dapui.open","    dap.listeners.before.event_terminated['dapui_config'] = dapui.close","    dap.listeners.before.event_exited['dapui_config'] = dapui.close","","    -- Install golang specific config","    require('dap-go').setup()","  end,","}"],"stylingDirectives":[[{"start":0,"end":12,"cssClass":"pl-c"},{"start":0,"end":2,"cssClass":"pl-c"}],[{"start":0,"end":2,"cssClass":"pl-c"},{"start":0,"end":2,"cssClass":"pl-c"}],[{"start":0,"end":54,"cssClass":"pl-c"},{"start":0,"end":2,"cssClass":"pl-c"}],[{"start":0,"end":2,"cssClass":"pl-c"},{"start":0,"end":2,"cssClass":"pl-c"}],[{"start":0,"end":64,"cssClass":"pl-c"},{"start":0,"end":2,"cssClass":"pl-c"}],[{"start":0,"end":65,"cssClass":"pl-c"},{"start":0,"end":2,"cssClass":"pl-c"}],[{"start":0,"end":46,"cssClass":"pl-c"},{"start":0,"end":2,"cssClass":"pl-c"}],[],[{"start":0,"end":6,"cssClass":"pl-k"}],[{"start":2,"end":49,"cssClass":"pl-c"},{"start":2,"end":4,"cssClass":"pl-c"}],[{"start":2,"end":25,"cssClass":"pl-s"},{"start":2,"end":3,"cssClass":"pl-pds"},{"start":24,"end":25,"cssClass":"pl-pds"}],[{"start":2,"end":51,"cssClass":"pl-c"},{"start":2,"end":4,"cssClass":"pl-c"}],[{"start":15,"end":16,"cssClass":"pl-